$.prettyPrint=function(obj,indent){var result="";null==indent&&(indent="");for(var property in obj){var value=obj[property];if("string"==typeof value)value="'"+value+"'";else if("object"==typeof value)if(value instanceof Array)value="[ "+value+" ]";else{var od=$.prettyPrint(value,indent+"    ");value="{\n"+od+"\n"+indent+"}"}result+=indent+"'"+property+"' : "+value+",\n"}return result.replace(/,\n$/,"")};